import React from 'react';

const Heading = () => {
    return (
        <div
        style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            width: "100%",
        }}>
            <h1>
                Hello, React!
            </h1>
        </div>
    );
};

export default Heading;
